import React, { useState } from "react";
import styles from "../scss/navigation.module.scss";
import { Link } from "react-router-dom";

const navigation = props => {
  const [activePage, setActivePage] = useState(false);
  const onClick = e => {
    setActivePage(true);
  };
  return (
    <div className={styles.navContainer}>
      <ul className={styles.navBar}>
        <li>
          <Link to="/">
            <div className={styles.logoImage} />
          </Link>
        </li>
        <ul>
          <Link to="/AboutMe" onClick={() => onClick("about")}>
            <li
              className={
                activePage
                  ? [styles.aboutYellow, styles.cliked].join(" ")
                  : styles.aboutYellow
              }
            >
              <span>ABOUT ME</span>
            </li>
          </Link>
          <Link to="/Work" onClick={() => onClick("work")}>
            <li
              className={
                activePage
                  ? [styles.workPink, styles.cliked].join(" ")
                  : styles.workPink
              }
            >
              <span>WORK</span>
            </li>
          </Link>
          <Link to="/Contact" onClick={() => onClick("contact")}>
            <li className={styles.contactBlue}>
              <span>CONTACT</span>
            </li>
          </Link>
        </ul>
      </ul>
    </div>
  );
};

export default navigation;
